import React from 'react';

import Banner from './blogdetails/banner';
import BlogCategory from './blogdetails/blogcategory';
import BlogArea from './blog/blogarea';

function BlogDetails() {
    return (
        <react-fragment>
            <Banner />
            <BlogCategory />
            <BlogArea/>
        </react-fragment>
    );
}

export default BlogDetails;
